import {NavBar,Nav,NavLink} from 'react-bootstrap/Navbar';

function NavBars() {
    return (
        <div>
            <Nav>
                <NavLink to='/'>
                   <h1>logo</h1>
                </NavLink>
            </Nav>
        </div>
    );
}

export default NavBars;
